<div id="imputed-vs.-observed-density" class="section level1">
<h1>Imputed vs.Observed Density</h1>
<p>This part will show the density between the imputed and observed values for all variables.</p>
<pre class="r"><code>for (i in 3:46) {
  tryCatch({
  compare.density(ImputedData, var = i)
